def _test_equivalency():
    '''
    Are coefficients the same for wavepy and pywavelets library calls?

    2020-06-23 bjs added more wavelet coefficients. Did a bit of optimization.
      the local code runs about 3 times faster than wavepy-1.0 module, and pywt still
      runs 10 times faster than the local code.  Sigh.

    2020-02-17 bjs tested for Python 3.7.4 and values for coeffs0, coeffs1 and coeffs2 
    showed 10e-5 to 10e-7 diffs between them, as did the reconstructed data. So the 
    libraries are all still in sync for these tests and python 3, pywavelets 1.1.1 vs 0.3.0
    
    '''
    import pywt
    import wavepy as wv     # need to install wavepy-0.1 module

    data = data64

    wavelet = 'coif3'   
    _mode = 'per'
    base_level = int(np.log(len(data))/np.log(2))   

    coeffs0                 = pywt.wavedec(data, wavelet, _mode, level=base_level)
    [coeffs1,length1,flag1] = wv.dwt.dwt(data, base_level, wavelet, _mode)
    coeffs2,length2,alert2   = dwt(wavelet, data, base_level)

    diffA = np.concatenate(coeffs0) - coeffs1
    diffB = coeffs1 - coeffs2

    length1 = [int(item) for item in length1]

    mean0 = np.mean(np.concatenate(coeffs0))
    mean1 = np.mean(coeffs1)
    mean2 = np.mean(coeffs2)

    # first 4 coeffs for pywt are different from other libs, but we never
    # zero these out since they are the broadest dyads, so it is a moot point.
    print("Mean coeffs (pywt, wavepy, local) - ",mean0, mean1, mean2)
    print("Mean data value                   - "+str(np.mean(data)))
    print("Compare coeffs, pywt vs wavepy  - Max Diff = " + str(np.max(diffA[5:]))+"   mean Diff A = "+str(np.mean(diffA[5:])))
    print("Compare coeffs, wavepy vs local - Max Diff = " + str(np.max(diffB))    +"   mean Diff B = "+str(np.mean(diffB)))

    recon0 = pywt.waverec(coeffs0, wavelet, _mode)
    recon1 = wv.dwt.idwt(coeffs1, wavelet, length1, flag1)
    recon2 = idwt(wavelet, coeffs2, length2, alert2)

    diffC = recon0 - recon1
    diffD = recon1 - recon2

    print("Compare recon, pywt vs wavepy  - Max Diff = " + str(np.max(diffC))+"   mean Diff C = "+str(np.mean(diffC)))
    print("Compare recon, wavepy vs local - Max Diff = " + str(np.max(diffD))+"   mean Diff D = "+str(np.mean(diffD)))
    


