# Stub methods to simplify seeing total time in cProfile listing



def _test_timing():

    import pywt
    import wavepy as wv     # need to install wavepy-0.1 module

    def _do_pywt(n):
        for i in range(n):
            coeffs0 = pywt.wavedec(data64, 'coif3', 'per', level=int(np.log(len(data64)) / np.log(2)))
            recon0 = pywt.waverec(coeffs0, 'coif3', 'per')

    def _do_wavepy(n):
        for i in range(n):
            [coeffs1, length1, flag1] = wv.dwt.dwt(data64, int(np.log(len(data64)) / np.log(2)), 'coif3', 'per')
            length1 = [int(item) for item in length1]
            recon1 = wv.dwt.idwt(coeffs1, 'coif3', length1, flag1)

    def _do_local(n):
        for i in range(n):
            [coeffs2, width2, alert2] = dwt('coif3', data64, int(np.log(len(data64)) / np.log(2)))
            recon2 = idwt('coif3', coeffs2, width2, alert2)

    n = 100
    _do_pywt(n)
    _do_wavepy(n)
    _do_local(n)

